  jclass classString = (*jenv)->FindClass(jenv, "java/lang/String");
  jclass classArray = (*jenv)->FindClass(jenv, "[Ljava/lang/Object;");

  jobjectArray outerJNIArray = (jobjectArray)(*jenv)->NewObjectArray(jenv, 2, classArray, NULL);

